    displayClicked: false,
  };

  [modalDisplay, updateModalDisplay] = useState(false);

  let stateCopy = { ...projectState };

  return (
    <React.Fragment>
      <div className={classes.ContentHolder}>
        <Modal title="test" open={modalDisplay} />
        <div className={classes.Header}>
          {" "}
          Landan <br></br> Early
        </div>
        <div className={classes.ProjectsOverview}>
          {Object.keys(stateCopy).map((currentValue) => {
            return (
              <div className={classes.ProjectContainer}>
                <div
                  className={classes.Box}
                  onClick={() => updateModalDisplay(true)}
                ></div>
                <p>
                  Date Posted:<span>{stateCopy[currentValue].date}</span>
                </p>
              </div>
            );
          })}
        </div>
      </div>
    </React.Fragment>
  );
};
export default contentHolder;
